import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Nav from "./Nav";
import Banner from "./Banner";
import BannerData , {BannerBox , TwoSecData} from "./Data";
import twoSec from "./TwoSec";

ReactDOM.render(
    <>
        <div className="header">
            <Nav/>

           <Banner/>

        </div>
        <div className="twoSec">
             {TwoSecData.map}
        </div>
    </>,document.getElementById("root")
);
